import React from 'react'
import defaultImage from './logo.svg';

const Results = (props) => {
  const {path,output,closeModel,processimage,outoutState}=props
  function onclickfun(){
    outoutState([])
    processimage(defaultImage)
    closeModel(false);
  }
  return (
    <div>
      <img src={path}></img>
      <button onClick={onclickfun}></button>
    </div>
  );
};

export default Results;
